import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./project/home.js";
import Contact from "./project/contact.js";
import Reservation from "./project/reservation.js";
import Menu from "./project/menu";

function App() {


  food=[{category: "Appetizer", name: "Burger", img: "", desc: "", price: ""},
  {category: "Appetizer", name: "Burger", img: "", desc: "", price: ""}]



  return (
    <>
      <Router>
        <div>
          <Routes>
            <Route exact path="/" element={<Home/>} />
            <Route exact path="/contact" element={<Contact/>} />
            <Route exact path="/reservation" element={<Reservation/>} />
            <Route exact path="/menu" element={<Menu/>} />
          </Routes>
        </div>
      </Router>
    </>
  );
}

export default App;
